class EachStock extends Component {
    render(){
        return(
            <Nav defaultActiveKey="/home" as="ul">
                <Nav.Item as="li">
                    <Nav.Link>Active</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link>Link</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link >Link</Nav.Link>
                </Nav.Item>
            </Nav>
        );
    }
}
export default EachStock;
